clear all
%%
%[text] ## Zadatak
load T_finalna_korelacija.mat
disp (T_finalna_korelacija) %[output:0357112e]
T_finalna_korelacija(:,{'immunity_proxy_deaths','onset','PCA_starost'})=[] %[output:1544ee41]
X= table2array(T_finalna_korelacija(:,1:7)); %[output:3c6d29f4]
Y= table2array(T_finalna_korelacija(:,end)); %[output:7550b4d9]

%%
%[text] ## Optimizacija hiperparametara
struct_hyper_opt=struct('UseParallel',true,'Optimizer','bayesopt','AcquisitionFunctionName','expected-improvement-per-second-plus','Repartition',true,'ShowPlots',false,'Verbose',1,'MaxObjectiveEvaluations',500);

%%
%[text] ## Random forest
predictorNames={'stringency','pop_density','cardiovasc','diabetes','PCA vakcinacija','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3'};
responseName= 'R_mean' %[output:1b19bb5e]
%Mdl1=fitrensemble(X,Y,"ResponseName",responseName,"PredictorNames",predictorNames,OptimizeHyperparameters={'MinLeafSize','MaxNumSplits'},Method="Bag",hyperparameterOptimizationOptions=struct_hyper_opt,NumLearningCycles=500)
%save('Mdl1.mat',"Mdl1")
%%
%[text] ## Znacaj prediktora
load Mdl1.mat
prediction=predictorImportance(Mdl1) %[output:4fa720eb]
figure; %[output:1fea4586]
bar(prediction) %[output:1fea4586]
set(gca,'XTickLabel',predictorNames,'XTick',1:numel(predictorNames)) %[output:1fea4586]
xlabel('Prediktori') %[output:1fea4586]
ylabel('Značaj') %[output:1fea4586]
[~,sortedIdx]=sort(prediction,'descend') %[output:40f24e4f]

figure; %[output:9d9fe3bb]
subplot(1,3,1) %[output:9d9fe3bb]
plotPartialDependence(Mdl1,sortedIdx(1),X) %[output:9d9fe3bb]
subplot(1,3,2) %[output:9d9fe3bb]
plotPartialDependence(Mdl1,sortedIdx(2),X) %[output:9d9fe3bb]
subplot(1,3,3) %[output:9d9fe3bb]
plotPartialDependence(Mdl1,sortedIdx(3),X) %[output:9d9fe3bb]
%%
top2=sortedIdx(1:2);
[f,x,x1]=partialDependence(Mdl1,top2,X);
%%
%[text] ## 2D vizuelizacija zavisnosti
figure; %[output:1b19e3c1]
imagesc(x,x1,f') %[output:1b19e3c1]
set(gca,'YDir','normal') %[output:1b19e3c1]
colorbar; %[output:1b19e3c1]
xlabel(sprintf(predictorNames{sortedIdx(1)})) %[output:1b19e3c1]
ylabel(sprintf(predictorNames{sortedIdx(2)})) %[output:1b19e3c1]
title('Parcijalna zavisnost(2 najznačajnija prediktora)') %[output:1b19e3c1]
%%
%[text] ## 3D vizuelizacija zavisnosti
[X1,X2]=meshgrid(x,x1);
F=f';
figure; %[output:5f520015]
surf(X1,X2,F,'EdgeColor','none') %[output:5f520015]
colorbar; %[output:5f520015]
xlabel(sprintf(predictorNames{sortedIdx(1)})) %[output:5f520015]
ylabel(sprintf(predictorNames{sortedIdx(2)})) %[output:5f520015]
zlabel('Predikcija') %[output:5f520015]
title ('Parcijalna zavisnost (2 najznačajnija prediktora)') %[output:5f520015]







